import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import { Container } from "react-bootstrap";

const App = () => {
  return (
    <>
      <Header />
      <main>
        <Container>
          <Row>
            <Col className="text-center py-3">Copyright &copy; Proshop</Col>
          </Row>
        </Container>
      </main>
      <Footer />
    </>
  );
};

export default App;
